function prepare(input) {
    const preparedForParsing = input.substring(5).replace(/\n/g, '')
    const json = JSON.parse(preparedForParsing)
    const results = json[0][1].map(array => array[14])
    return results
}

function prepareLookup(data) {
    return function lookup(...indexes) {
        const indexesWithBrackets = indexes.reduce((acc, cur) => `${acc}[${cur}]`, '')
        const cmd = `data${indexesWithBrackets}`
        try {
            const result = eval(cmd)
            return result
        } catch(e) {
            return null
        }
    }
}

function buildResults(preparedData) {
    const results = []
    for (const place of preparedData) {
        const lookup = prepareLookup(place)
        const result = {
            address: {
                street_address: lookup(183, 1, 2),
                city: lookup(183, 1, 3),
                zip: lookup(183, 1, 4),
                state: lookup(183, 1, 5),
                country_code: lookup(183, 1, 6),
            },
            name: lookup(11),
            tags: lookup(13),
            notes: lookup(25,15,0,2),
            placeId: lookup(78),
            phone: lookup(178,0,0),
            coordinates: {
                long: lookup(208,0,2),
                lat: lookup(208,0,3)
            }
        }
        results.push(result)
    }

    return results
}


function converResultsToMap(listResults) {
    function slugify(text) { // https://gist.github.com/codeguy/6684588
        return text
            .toString()                   // Cast to string (optional)
            .normalize('NFKD')            // The normalize() using NFKD method returns the Unicode Normalization Form of a given string.
            .replace(/[\u0300-\u036f]/g, '')   // remove all previously split accents
            .toLowerCase()                // Convert the string to lowercase letters
            .trim()                       // Remove whitespace from both sides of a string (optional)
            .replace(/\s+/g, '-')         // Replace spaces with -
            .replace(/[^\w\-]+/g, '')     // Remove all non-word chars
            .replace(/\_/g,'-')           // Replace _ with -
            .replace(/\-\-+/g, '-')       // Replace multiple - with single -
            .replace(/\-$/g, '');         // Remove trailing -
    }

    const mapResults = listResults.reduce((acc, cur) => {
        const slugifiedName = slugify(cur.name)
        acc[slugifiedName] = cur
        return acc
    }, {})
    return mapResults
}

function writeToFile(mapResults) {
    const reviewsDir = path.resolve(__dirname, '../../_reviews')
    const reviewsDirFiles = fs.readdirSync(reviewsDir).map(filename => path.basename(filename, '.md'))
    const dataFile = path.resolve(__dirname, '../../_data/reviews.json')

    // files to add
    Object.keys(mapResults)
        .filter(reviewSlug => !reviewsDirFiles.includes(reviewSlug))
        .map(reviewSlug => {
            const content = `---\nkey: ${reviewSlug}\n---`
            const filePath = path.resolve(reviewsDir, `${reviewSlug}.md`)
            fs.writeFileSync(filePath, content)
        })

    // files to delete
    reviewsDirFiles.filter(reviewSlug => !(reviewSlug in mapResults))
        .map(reviewSlug => {
            const filePath = path.resolve(reviewsDir, `${reviewSlug}.md`)
            fs.unlinkSync(filePath)
        })

    // write the mapResults to our file
    if (fs.existsSync(dataFile)) {
        fs.unlinkSync(dataFile)
    }
    fs.writeFileSync(dataFile, JSON.stringify(mapResults))
}

